attributes.vnfd:
description: Demo example
metadata: {template_name: sample-tosca-vnfd}
topology_template:
  node_templates:
    CP1:
      properties: {anti_spoofing_protection: false, management: true, order: 0}
      requirements:
      - virtualLink: {node: VL1}
      - virtualBinding: {node: VDU1}
      type: tosca.nodes.nfv.CP.Tacker
    VDU1:
      capabilities:
        nfv_compute:
          properties: {disk_size: 1 GB, mem_size: 512 MB, num_cpus: 1}
      properties: {image: cirros-0.4.0-x86_64-disk}
      type: tosca.nodes.nfv.VDU.Tacker
    VL1:
      properties: {network_name: net_mgmt, vendor: Tacker}
      type: tosca.nodes.nfv.VL
tosca_definitions_version: tosca_simple_profile_for_nfv_1_0_0
